#if (os(macOS) || os(iOS) || os(tvOS) || os(watchOS))

import Foundation
    
public struct Assets {
    public struct Fonts {
        private static let base64 = ""
        public static var data: Data {
            return Data(base64Encoded: base64)!
        }
    }
    
    public struct Sounds {
        private static let beep1Base64 = ""
        private static var beep1Data: Data {
            return Data(base64Encoded: beep1Base64)!
        }
        public static var beep1URL: URL? {
            return url(forData: beep1Data, filename: "beep1", pathExtension: "m4a")
        }
        
        private static let beep2Base64 = ""
        private static var beep2Data: Data {
            return Data(base64Encoded: beep2Base64)!
        }
        public static var beep2URL: URL? {
            return url(forData: beep2Data, filename: "beep2", pathExtension: "m4a")
        }
        
        private static let beep3Base64 = ""
        private static var beep3Data: Data {
            return Data(base64Encoded: beep3Base64)!
        }
        public static var beep3URL: URL? {
            return url(forData: beep3Data, filename: "beep3", pathExtension: "m4a")
        }
        
        private static func url(forData data: Data, filename: String, pathExtension: String) -> URL? {
            let fm = FileManager.default
            guard let directory = fm.urls(for: .documentDirectory, in: .userDomainMask).first else {
                print("No URL for use documents directory.")
                return nil
            }
            
            let url = directory.appendingPathComponent(filename).appendingPathExtension(pathExtension)
            
            if !fm.fileExists(atPath: url.path) {
                do {
                    try data.write(to: url)
                } catch {
                    print(error.localizedDescription)
                    return nil
                }
            }
            
            return url
        }
    }
}

#endif
